import React, { useState, useEffect } from 'react';

const AuthorsList = () => {
  const [getList, setList] = useState(null);

  useEffect(() => {
    getAuthorsList();
  }, []);

  const getAuthorsList = async () => {
    const response = await fetch("https://www.thequint.com/api/v1/authors");
    const data = await response.json();
    
    setList(data.items);
    
    console.log(setList);
  };

  return (
    <div className="Authors-list">
      {
        getList && getList.map((item, index) => (<div key={index}> 
            <div>
                <div>{item.authors.name}</div>
                <div>{item.authors['avatar-url']}</div>
            </div>
            </div>
        ) )

        
      }
    </div>
  );
};
    
export default AuthorsList;
